import React from 'react';
import { NavLink } from 'react-router-dom';
import './NavigationItems.css'

const navigationItems = (props) => {
   
    let options = props.navItems.map(item=>{
        return <option>item.</option>
    })

   
   return (<React.Fragment>
    <ul className='NavItems'>
        <li><NavLink to='/'>Home</NavLink></li>
        <li><NavLink to='/jam-pads'>Jam pads</NavLink></li>
        <li><NavLink to='/bookings'>Bookings</NavLink></li>
    </ul>
    <select className='navDrop'>
        <NavLink to='/'><option>Home</option> </NavLink>  
       <NavLink to='/jam-pads'> <option>Jam pads</option></NavLink>   
       <NavLink to='/bookings'> <option>Bookings</option> </NavLink> 
    </select>
    
    </React.Fragment>);
};
export default navigationItems;
